import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
const Home = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [result, setResult] = useState([]);
  const [error, setError] = useState('');
  
  const Handlesearch = async (e) => {
    e.preventDefault();

    if (searchTerm.trim() === '') {
      alert("Please enter a stock to search");
      return;
    }

    try {
      const res = await fetch('http://localhost:3001/companies/search', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ query: searchTerm }),
      });

      const data = await res.json();

      if (!res.ok) {
        setResult([]);
        setError(data.message || 'Search failed');
        return;
      }

      setError('');
      setResult(data);
    } catch (error) {
      console.error('‚ùå Search failed:', error);
      setError('Server error. Please try again later.');
    }
  };

  return (
    <div className="min-h-screen bg-slate-100 flex flex-col items-center dark:bg-gray-900 text-gray-900 dark:text-white px-4">
      <div className="-translate-y-20 text-center">
        <div className="flex justify-center items-center text-5xl text-blue-700 font-bold">
          <img
            className="h-20 w-auto mx-3 border rounded-3xl"
            src="/Finoro logo.png"
            alt="logo"
          />
          FINORO
        </div>
        <h1 className="mt-2 text-xl text-black font-serif dark:text-white">
          Stock analysis and screening tool for investors in India.
        </h1>

        <form onSubmit={Handlesearch} className="mt-4 flex justify-center">
          <input
            className="w-4/5 h-12 border border-cyan-600 rounded-3xl text-center mx-1"
            type="text"
            placeholder="Search for a stock..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
          <button
            type="submit"
            className="px-4 py-2 bg-blue-600 text-white rounded-3xl hover:bg-blue-700"
          >
            Search
          </button>
        </form>

        <h1 className="mt-4 text-lg">Or Analyze‚Ä¶</h1>

        {error && <p className="text-red-600 mt-4">{error}</p>}
      </div>

      {/* Table to display search results */}
      {result.length > 0 && (
        <div className="mt-10 w-full max-w-5xl overflow-x-auto">
          <table className="min-w-full bg-white border dark:bg-gray-800 dark:border-gray-600 text-left text-sm">
            <thead className="bg-gray-200 dark:bg-gray-700">
              <tr>
                {Object.keys(result[0]).map((key) => (
                  <th key={key} className="px-4 py-2 capitalize border-b dark:border-gray-600">
                    {key}
                  </th>
                ))}
              </tr>
            </thead>
            <tbody>
              {result.map((company, index) => (
                <tr key={index} className="hover:bg-gray-100 dark:hover:bg-gray-700">
                  {Object.values(company).map((value, i) => (
                    <td key={i} className="px-4 py-2 border-b dark:border-gray-600">
                      {value}
                    </td>
                  ))}
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default Home;

